import React from "react";
import Manager from  './Manager'


export default function MainManager() {
  return (
    <div style={{ display: 'flex'  }}>
      <div>
        <h1>Go home</h1>
        <hr />
        <h1>Manager</h1>
        <div>
          <h1>Manager</h1>
        </div>
      </div>
      <div>
        <Manager />
      </div>
    </div>
  );
}
